import React, { useState, useEffect } from 'react';
import '../pages/styles/Workout.css';
import Navbar2 from '../components/Navbar2';
import Footer from '../components/Footer';

const fetchWorkouts = async () => {
  try {
    const response = await fetch('/api/workouts');
    if (!response.ok) {
      throw new Error('Failed to fetch workouts');
    }
    const data = await response.json();
    return data.map(({ objectiveId, userId, ...rest }) => rest);
  } catch (error) {
    console.error('Error fetching workouts:', error);
    return [];
  }
};

const Workouts = () => {
  const [workouts, setWorkouts] = useState([]);

  useEffect(() => {
    const getData = async () => {
      const workoutData = await fetchWorkouts();
      setWorkouts(workoutData);
    };

    getData();
  }, []);

  return (
    <div>
      <Navbar2 />
      <div className='workouts-container'>
        <div className='header-workouts'>
          <h1>Workouts</h1>
          <p>Explore a variety of exercises to suit your fitness goals.</p>
        </div>

        <div className='workouts-categories'>
          {workouts.length === 0 ? (
            <p>Loading workouts...</p>
          ) : (
            workouts.map((workout, index) => (
              <div className='workout-card' key={index}>
                <h2>{workout.objectiveType}</h2>
                <p>Target: {workout.targetValue} kg</p>
                <p>Progress: {workout.progress} kg</p>
                <p>
                  Start Date: {new Date(workout.startDate).toLocaleDateString()}
                </p>
                <p>
                  Deadline: {new Date(workout.deadline).toLocaleDateString()}
                </p>
              </div>
            ))
          )}
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default Workouts;
